import React, { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [status, setStatus] = useState(null);

  useEffect(() => {
    // You can check the backend or make a test call
    setStatus("App is running"); // This can be fetched dynamically from the backend
  }, []);

  return (
    <div className="App">
      <h1>{status || "Loading..."}</h1>
    </div>
  );
}

export default App;
